import React from 'react';
import "./display.scss";

interface NumberDisplay{
    value: number;
}

const Number: React.FC<NumberDisplay> = ({value}) => {
    return <div className="numberDisplay">{value.toString().padStart(3)}</div>
}

export default Number;
